function refresh()
{
	let packet = new Array(65).fill(0);
	device.send_report(packet, 65);
	device.pause(1);
	packet[1] = 0x04;
	packet[2] = 0x02;
	device.send_report(packet, 65);
	device.pause(1);
	let data = new Array(65).fill(0);
	device.get_report(data,65);
	device.pause(1);

}
function start_refresh()
{
	let packet = new Array(65).fill(0);
	packet[1] = 0x04;
	packet[2] = 0x20;
	packet[9] = 0x08;
	device.send_report(packet, 65);
	device.pause(1);
	let data = new Array(65).fill(0);
	device.get_report(data,65);
	device.pause(1);
	
	// device.send_report(data,1);
}




